er. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>"));jE(b,50,d);kE(b)};_.cM={11:1,22:1};_=bR.prototype=aR.prototype=new u;_.gC=function cR(){return Sq};_.sc=function dR(a){var b,c,d,e;b=new mE;d=ol(a.g,45);c=this.b.G;e=Md(d.y)+10;oB(b,new CC(c));jE(b,50,e);kE(b)};_.cM={11:1,22:1};_.b=null;_=fR.prototype=eR.prototype=new u;_.gC=function gR(){return Tq};_.sc=function hR(a){var b,c,d;b=new mE;c=ol(a.g,45);d=Md(c.y)+10;oB(b,new CC("<div><h1>Installation Guidelines<\/h1><br><p>The power of a solar system tells you how much energy it CAN produce, and is measured by the unit of power, kilowatts (kW). This measure is telling you how big the system is, or in other words, what it's capacity to produce power is. The amount of energy a solar system will produce is measured in kilowatt hours (kWh) ?which remember, is just another way of talking about energy which is otherwise measured in joules. Site your solar panel array where there will be no regular shading. This is the first and most obvious step to making sure your system does not suffer the consequences of being partially shaded.<\/p><br><p>It is extremely important to consider all times of day for all seasons of the year when working out whether some nearby object might cast a shadow onto your roof. You can check this yourself or alternatively your Solar Choice broker will check to ensure there is no shading on your roof using a program called Nearmap. Solar system owners should also be vigilant in making sure that there are no nearby trees which might grow tall enough to eventually cause shading issues. Solar system lifespans are typically expected to be 25+ years, during which time trees have plenty of time to grow. Clouds are another source of potential shading.<\/p><br><p>Clouds passing through the sky during the day may also result in fluctuations in system output, but these are basically unavoidable. Amorphous silicon solar cells are said to be better at handling shading than crystalline silicon solar panels, but generally speaking the relatively low overall efficiency of amorphous panels means that crystalline modules are a better choice. There are some other technologies under development that may offer high efficiencies even in inclement weather, such as 'super black' solar cells, but most of these are still either expensive or not yet commercially available.<\/p><br><p>Roof space available for solar panels. One obvious factor to be taken into consideration when mounting panels on a roof is the amount of space available on it. A typical polycrystalline or monocrystalline panel measures about 1.6m x 1m, and depending on the capacity (size in watts) of your system, for an average 2 or 3-bedroom home, you should be able to fit enough panels to significantly offset your electricity costs on one, or in a stretch, two parts of your roof. Closeness of the panels to your home is not an absolute requirement: the roofs of sheds, garages, and balconies that stand slightly apart from your house may also provide options for placement.<\/p><\/div>"));jE(b,50,d);kE(b)};_.cM={11:1,22:1};_=pR.prototype=iR.prototype=new Xw;_.gC=function qR(){return Uq};var jR;_=uR.prototype=rR.prototype=new By;_.gC=function vR(){return Vq};var sR=null;_=GR.prototype=wR.prototype=new u;_.gC=function HR(){return Xq};_.tS=function IR(){return FR(this)};_.cM={50:1,76:1};_.f=null;_.g=null;_.i=null;_.j=null;_.k=null;_.n=null;_=NR.prototype=KR.prototype=new u;_.gC=function OR(){return Yq}
